// src/components/Local Manager Dashboard/LocManagerSidebar.js
import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import './LocManagerDashboard.css';

const LocManagerSidebar = () => {
  const location = useLocation();
  const getLinkClass = (path) => location.pathname.includes(path) ? 'sidebar-link active' : 'sidebar-link';

  return (
    <div className="manager-sidebar">
      <div className="sidebar-logo">
        <span role="img" aria-label="logo">üå°Ô∏è</span> HSMD.
      </div>

      <div className="sidebar-section">
        <div className="sidebar-title">MENU</div>
        <ul>
          <li><Link to="/local-manager" className={getLinkClass('/local-manager')}>Dashboard</Link></li>
          <li><Link to="/local-manager/company-profile" className={getLinkClass('company-profile')}>Company Profile</Link></li>
        </ul>
      </div>

      <div className="sidebar-section">
        <div className="sidebar-title">ANALYTICS</div>
        <ul>
          <li><Link to="/local-manager/zone-monitoring" className={getLinkClass('zone-monitoring')}>Zone Monitoring</Link></li>
          <li><Link to="/local-manager/performance-metrics" className={getLinkClass('performance-metrics')}>Performance Metrics</Link></li>
          <li><Link to="/local-manager/training" className={getLinkClass('training')}>Training</Link></li>
          <li><Link to="/local-manager/alerts" className={getLinkClass('alerts')}>Alerts & Notifications</Link></li>
        </ul>
      </div>

      <div className="sidebar-section">
        <div className="sidebar-title">HELP</div>
        <ul>
          <li><Link to="/local-manager/settings" className={getLinkClass('settings')}>Settings</Link></li>
          <li><Link to="/local-manager/tutorial" className={getLinkClass('tutorial')}>Tutorial</Link></li>
        </ul>
      </div>
    </div>
  );
};

export default LocManagerSidebar;
